import {React, Component}from 'react';
import { getEventDetails } from '../services/event';


export default class EventDetails extends Component {

  state = {
    event: null
  }

  componentDidMount() {
    getEventDetails().then(event => {
      this.setState({ event: event })
    });
  }

  render() {

    return (

      <div>
        <h2>Event Details!!!!!</h2>
      </div>
    )
  }
}
